import * as React from "react";
import { BarChart } from "@mui/x-charts/BarChart";

const BasicBars = (lable1, lable2) => {
  return (
    <div>
    <BarChart
      xAxis={[{ scaleType: "band", data: [lable1, lable2] }]}
      series={[{ data: [3, 5] }]}
      width={500}
      height={300}
    />
    </div>
  );
};
export default BasicBars;
